import NavbarLogin from "./components/navbarLogin";
import Footer from "./components/footer";
import { useState } from "react";
import { useEffect } from "react";
import { API } from "./config/api";
import  TrasactionCard from'./transaction-card'


function Transactions(){
 
  const [trs, setTrs] = useState([]);
    // Create function get products data from database here ...
    const getTrs = async () => {
      try {
        const response = await API.get("/users");
        setTrs(response.data.data);
      } catch (error) {
        console.log(error);
      }
    };
    // Call function get products with useEffect didMount here ...
    useEffect(() => {
      getTrs();
    }, []);


    const [data, setData] = useState({
      email:"",
      password:"",
      attachment:trs.attachment,
      phone:"",
      status:""
    })
 
    return(
        <>
            <NavbarLogin/>
            <div id="card">
            <table class="table table-striped">
  <thead>
    <tr>
      <th scope="col">No</th>
      <th scope="col">Users</th>
      <th scope="col">Trip</th>
      <th scope="col">Bukti Transfer</th>
      <th scope="col">Status Payment</th>
      <th scope="col">Action</th>
    </tr>
  </thead>
  <tbody>

  </tbody>
</table>

            </div>

            <Footer/>
        </>
    )
}
export default Transactions
